urce":["# **Act Phase/Recommendations**"]},{"cell_type":"markdown","id":"a8f218d0","metadata":{"papermill":{"duration":0.033824,"end_time":"2022-08-26T17:21:25.279714","exception":false,"start_time":"2022-08-26T17:21:25.24589","status":"completed"},"tags":[]},"source":["Bellabeat is company that focuses on women's health and well-being, so we shall move cautiously with the recommendations. Given that the sample size is around 30 users, we cannot draw several insightful conclusions. Therefore, my strongest suggestion would be to collect more reliable and specific data about Fitbit users and specify demographics, such as gender, age, and health status.  "]},{"cell_type":"markdown","id":"77efee86","metadata":{"papermill":{"duration":0.033222,"end_time":"2022-08-26T17:21:25.34631","exception":false,"start_time":"2022-08-26T17:21:25.313088","status":"completed"},"tags":[]},"source":["*After analyzing the given FitBit Fitness Tracker data, I would recommend the following to **improve Bellabeat's marketing strategy**:*"]},{"cell_type":"markdown","id":"4f2edfb5","metadata":{"papermill":{"duration":0.033748,"end_time":"2022-08-26T17:21:25.413552","exception":false,"start_time":"2022-08-26T17:21:25.379804","status":"completed"},"tags":[]},"source":["#### Viz 1, 2, & 3: \n","\n","* Since activity influences the amount of calories burned and users spend more time being sedentary than active, sending **motivational notifications** to users would remind them to exercise. According to the hourly intensity histogram, it appears that users are full-time workers. Bellabeat could first target this group in its marketing strategy by suggesting the type of activity based on the hour of the day. For example, at around 1pm-3pm, during lunch break, the reminder could be to go for a small walk or stretch. After work hours, the reminder could be to go to the gym.\n","\n","\n","#### Viz 4, 5, & 6: \n","\n","* Users' sleeping patterns are constant throughout the week. However, whenever they are sedentary, they tend to sleep less. If we implement the recommendation above, users might become more active, and this might help them sleep more. Also, since they are spending time in bed but no actually sleeping, Bellabeat could send **sleep notifications** to remind them to sleep. "]},{"cell_type":"markdown","id":"2575afb2","metadata":{"papermill":{"duration":0.034534,"end_time":"2022-08-26T17:21:25.48174","exception":false,"start_time":"2022-08-26T17:21:25.447206","status":"completed"},"tags":[]},"source":["# **Credits/Sources**\n","\n","This is my first data analytics project (and first go at R programming), so I'd like to thank the following authors who have given me clarity:\n","\n","* https://www.kaggle.com/code/chebotinaa/bellabeat-case-study-with-r/notebook\n","* https://www.kaggle.com/code/alexzixinhan/health-product-bellabeat-data-analysis-in-r\n","* https://www.kaggle.com/code/kathrynspuur/bellabeat-case-study-excel-sql-r/notebook\n","* Pictures taken from Bellabeat official website: https://bellabeat.com/ "]},{"attachments":{"e4154aac-39f0-470c-93f8-7e87dbc09ce9.png":{"image/png":""}},"cell_type":"markdown","id":"e497cf9b","metadata":{"papermill":{"duration":0.033131,"end_time":"2022-08-26T17:21:25.547475","exception":false,"start_time":"2022-08-26T17:21:25.514344","status":"completed"},"tags":[]},"source":["![image.png](attachment:e4154aac-39f0-470c-93f8-7e87dbc09ce9.png)"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":58.348392,"end_time":"2022-08-26T17:21:25.80341","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-08-26T17:20:27.455018","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}